import "./Contact.scss";

export default function Contact() {
  return (
    <>
      <div className="description">
        <h1>Mobile marketing w nowym wydaniu</h1>
        <p>Spróbuj kreatywnego i nieszablonowego podejścia do reklamy.</p>
        <p>
          Stwórz z nami dopasowane i przyciągające formaty reklamowe - bo wiemy,
          jak dotrzeć do Twojej grupy docelowej.
        </p>
      </div>

      <Navigation />
    </>
  );
}
